function processData(x) {
  let retEven = [];
  let retOdd = [];

  for (let i = 1; i <= +x[0]; ++i) {
    let evens = "";
    let odds = "";
    for (let j = 0; j < x[i].length; ++j) {
      if (j % 2 === 0) evens += x[i][j];
      else odds += x[i][j];
    }
    retEven.push(evens);
    retOdd.push(odds);
  }

  for (let i = 0; i < retOdd.length; ++i) {
    console.log(retEven[i] + " " + retOdd[i]);
  }
}

